import { React } from 'react'


export default (props) =>
{
    var numbers =[]
    for (let i=1; i<=10; i++)
    {
        numbers.push(i)
    }
   return(<>
           <div className="container p-5">
                <ul className="pagination">
                    {
                    numbers.map((res,i)=>` <li class="page-item">
                                <a class="page-link">${res}</a>
                                </li>`)
                            }
                </ul>
           </div>
       </>)
}
